import { fetchData, postData, updateData, deleteData } from './fetchAndRead';

const ENDPOINTS = {
    AUKTIONEN: '/auktionen',
    AUKTION_EXPONATE: '/auktion_exponate',
    GEBOTE: '/gebote',
    KUNDEN_GEBOTE: '/kunden_gebote'
};

class AuktionenService {
    static async fetchAuktionen() {
        return fetchData(ENDPOINTS.AUKTIONEN);
    }

    static async fetchAuktionById(auktionId) {
        return fetchData(`${ENDPOINTS.AUKTIONEN}/${auktionId}`);
    }

    static async createAuktion(auktionData) {
        return postData(ENDPOINTS.AUKTIONEN, auktionData);
    }

    static async updateAuktion(auktionId, updatedData) {
        return updateData(`${ENDPOINTS.AUKTIONEN}/${auktionId}`, updatedData);
    }

    static async deleteAuktion(auktionId) {
        return deleteData(`${ENDPOINTS.AUKTIONEN}/${auktionId}`);
    }

    // Exponate einer Auktion abrufen
    static async fetchAuktionExponate(auktionId) {
        return fetchData(`${ENDPOINTS.AUKTION_EXPONATE}/${auktionId}`);
    }

    // Gebote einer Auktion abrufen
    static async fetchAuktionGebote(auktionId) {
        return fetchData(`${ENDPOINTS.GEBOTE}/${auktionId}`);
    }

    // Ein neues Gebot abgeben
    static async placeBid(auktionId, bidData) {
        return postData(`${ENDPOINTS.KUNDEN_GEBOTE}/${auktionId}`, bidData);
    }

    // Ein Gebot aktualisieren
    static async updateBid(bidId, updatedBidData) {
        return updateData(`${ENDPOINTS.KUNDEN_GEBOTE}/${bidId}`, updatedBidData);
    }

    // Ein Gebot löschen
    static async deleteBid(bidId) {
        return deleteData(`${ENDPOINTS.KUNDEN_GEBOTE}/${bidId}`);
    }
}

export default AuktionenService;
